            var introspectionMethodRawValue = ThirdPartyNetworkResponse.IntrospectionMethodEnumToJsonValue(thirdPartyNetworkResponse.IntrospectionMethodOption.Value!.Value);
            writer.WriteString("introspectionMethod", introspectionMethodRawValue);
            if (thirdPartyNetworkResponse.EnableIntrospectionOption.IsSet)
                writer.WriteBoolean("enableIntrospection", thirdPartyNetworkResponse.EnableIntrospectionOption.Value!.Value);

            if (thirdPartyNetworkResponse.IntrospectionURLOption.IsSet)
                writer.WriteString("introspectionURL", thirdPartyNetworkResponse.IntrospectionURL);

            if (thirdPartyNetworkResponse.IntrospectionParamsOption.IsSet)
                writer.WriteString("introspectionParams", thirdPartyNetworkResponse.IntrospectionParams);

            if (thirdPartyNetworkResponse.RequiredRootFieldOption.IsSet)
                writer.WriteString("requiredRootField", thirdPartyNetworkResponse.RequiredRootField);
        }
    }
}
